import React from "react";
import Head from "./header";
import { BrowserRouter as Router, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "./developer.css";
import Footer from "./footer";
import Image1 from "./img/raw/clement-h-95YRwf6CNw8-unsplash.jpg";
import AOS from "aos";
import "aos/dist/aos.css";

function Developer() {
  // const jobs = () => [
  //     {}
  // ]
  AOS.init();

  return (
    <div>
      <Head />
      <div>
        <div className="about-banner fadeIn">
          <div>
            <hr style={{ marginTop: "0em" }} />
            <div className="darkbank-logo"><img src="https://darkbank.io/img/security-logo.png" alt="DarkBank" className="darkbank"/></div>

            <div className="blogus">WE ARE HIRING</div>
            <div className="home-blogus">
              <span>HOME</span>
              <i
                className="fa fa-angle-right"
                style={{
                  marginLeft: "0.3em",
                  marginRight: "0.3em",
                  fontSize: "1.3em"
                }}
              ></i>
              <span>WE ARE HIRING</span>
            </div>
          </div>
        </div>


      </div>
      <Footer />
    </div>
  );
}

export default Developer;
